import PropTypes from 'prop-types';

import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import CardMedia from '@material-ui/core/CardMedia';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardActions from '@material-ui/core/CardActions';
import Button from '@material-ui/core/Button';
import Container from "@material-ui/core/Container";
import { Link } from 'react-router-dom';
import { useTheme  } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  details: {
    display: 'flex',
    flexDirection: 'column',
  },
  content: {
    flex: '1 0 auto',
  },
  cover: {
    width: 151,
  },
  controls: {
    display: 'flex',
    alignItems: 'center',
    paddingLeft: theme.spacing(1),
    paddingBottom: theme.spacing(1),
  },
  playIcon: {
    height: 38,
    width: 38,
  },
}));



function HomePage() {
  const theme = useTheme();

  return (
    <>
      <h1>Home Page</h1>
      <Grid className={theme.root} container spacing={4}>
        <Grid item xs={12} sm={6} md={4}>
          <Card elevation={2} >
            <CardMedia
              height="240"
              component="img"
            // src={img}
            // title={name}
            />
            <CardContent>
              <Typography variant="h6"><strong>Characters</strong></Typography>
            </CardContent>
            <CardActions>
              <Button size="small" color="black">
                View
              </Button>
            </CardActions>
          </Card>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
          <Card elevation={2} >
            <CardMedia
              height="240"
              component="img"
            // src={img}
            // title={name}
            />
            <CardContent>
              <Typography variant="h6"><strong>Planets</strong></Typography>
            </CardContent>
            <CardActions>
              <Button size="small" color="black">
                View
              </Button>
            </CardActions>
          </Card>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
          <Card elevation={2} >
            <CardMedia
              height="240"
              component="img"
            // src={img}
            // title={name}
            />
            <CardContent>
              <Typography variant="h6"><strong>Species</strong></Typography>
            </CardContent>
            <CardActions>
              <Button size="small" color="black">
                View
              </Button>
            </CardActions>
          </Card>
        </Grid>
      </Grid>
    </>
  );
}


export default HomePage;
